The new In-line Perpetual Calendar Ref. 5236 in platinum presents the day, the date and the month in a unique large single aperture at 12 o’clock, a technical prowess for which 3 patents have been filed:

One for the coplanar display with ball bearings;

One for the self-blocking mechanism for the date disk of the units, that prevents any inadvertent display misalignment with the tens disk;

And one for the mechanism that allows the advance from the 31st to the 1st with no adjustment of the unit “1” for two days.

Enjoy the detailed technical presentation which will help you grasp the extreme complexity of this new mechanism.

